import React,{ Component } from 'react';

class ProductNew extends Component {
    constructor() {
        super();
        this.state = {
            stock: '',
            brand: '',
            type: '',
            price: '',
            newProduct: ''
        }
        this.stock = this.stock.bind(this);
        this.brand = this.brand.bind(this);
        this.type = this.type.bind(this);
        this.price = this.price.bind(this);
        this.newProduct = this.newProduct.bind(this);
    }
    stock(Event){
        this.setState({
            stock: Event.target.value
        });
    }
    brand(Event){
        this.setState({
            stock: Event.target.value
        });
        console.log("Hello Brand");
    }
    type(Event){
        this.setState({
            stock: Event.target.value
        });
        console.log("Hello Type");
    }
    price(Event){
        this.setState({
            stock: Event.target.value
        });
        console.log("Hello Price");
    }
    newProduct(Event) {
        console.log("New Product");
        this.props.history.push("/dashboard/product");
    }
    render() {
        console.log(this.state.stock);
        return(
            <div className="dchannel-content productnew">
                <div style={{ padding: "10px"}}>
                    <div className="row di-mg">
                        <div className="col-md-6">
                            <div className="row">
                                <div className="col-md-2">
                                    <label>Stock</label>
                                </div>
                                <div className="col-md-10">
                                    <input type=" "  onChange={this.stock}/>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="row di-mg">
                        <div className="col-md-6">
                            <div className="row">
                                <div className="col-md-2">
                                    <label>Brand</label>
                                </div>
                                <div className="col-md-10">
                                    <input type="text" onChange={this.brand}/>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="row di-mg">
                        <div className="col-md-6">
                            <div className="row">
                                <div className="col-md-2">
                                    <label>Type</label>
                                </div>
                                <div className="col-md-10">
                                    <input type="text" onChange={this.type}/>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="row di-mg">
                        <div className="col-md-6">
                            <div className="row">
                                <div className="col-md-2">
                                    <label>Price</label>
                                </div>
                                <div className="col-md-10">
                                    <input type="text" onChange={this.price}/>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="row di-mg">
                        <div className="col-md-6 text-right">
                            <button className="btn btn-gray" onClick={this.newProduct}>SAVE</button>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
export default ProductNew;
